import React from "react";

import "./ContactPage.css";
import ContentHeading from "../../shared/Heading/"

const ContactPage = () => {
    return (
        <React.Fragment>
            <ContentHeading className="heading-container">
                Contact Me
            </ContentHeading>
        </React.Fragment>
    );
};

export default ContactPage;
